import React from 'react'
import { StyleSheet } from 'react-native'
import { Text } from 'react-native-paper'

export default function Title(props) {
    return <Text style={styles.textt} {...props} />
  }

  const styles = StyleSheet.create({  
    textt: {
    flex: 1,
    fontFamily: 'Poppins',
    fontSize: 14,
    marginTop: 10,
    marginBottom: 10,
    color: 'black',
  },
})
